import React from "react";
import PropTypes from "prop-types";

const Title = props => {
  const labelStyle = {
    color: "white",
    fontWeight: "bold",
    fontSize: "1.8em"
  };

  return (
    <div style={{ display: "flex", alignItems: "center" }}>
      <div
        style={{
          width: "4px",
          height: "24px",
          backgroundColor: "#c7493a"
        }}
      ></div>
      <label className="component-label" style={labelStyle}>
        {props.titleName}
      </label>
    </div>
  );
};

const Featured = props => {
  return (
    <div className="featured">
      <Title titleName="Featured" />
    </div>
  );
};

class Home extends React.Component {
  render() {
    return (
      <div className="home">
        <Featured />
      </div>
    );
  }
}

export default Home;
